import './App.css';
import Data from './fruits.json';

function App() {
  return (
    <div className="App">
      <input placeholder='search...' type='text' className='search' />
      <ul>
        {Data.map((fruit, index)=>{
          return(
          <>
          <li className='listItem'>{fruit.name}
            <div>
              <img src={fruit.img} alt />
            </div>
          </li>
          </>
          )
        })}

      </ul>
    </div>
  );
}

export default App;
